const  getLanguages = async (req,res) => {
    try {
    const connection = await getConnection();
    const result = await connection.query("SELECT id,name,programers FROM language");
    console.log(result);
    res.json(result);
    }
    catch(err) {
        res.status(500);
        res.send(err.message)
    }
};

